import { Col, Container, Row } from "react-bootstrap";
import './About.css'
function About() {
  return (
<Container>
<div class="about-us">
        <div class="info-box">
          <h2>About Us</h2>
          <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Perferendis ipsum, tenetur dolores esse magni ratione distinctio! Quod iusto neque fuga, maxime quos nostrum quibusdam dicta deserunt blanditiis non voluptate id?</p>
        </div>
        <div class="image-box">
          <img src="../logo.png" alt=""/>
        </div>
      </div>
</Container>
  );
}
export default About;
